function PaginaInicial() {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-white">
      <div className="text-center p-4">
        <h1 className="text-4xl font-bold text-gray-800">Bem-vinda ao Nosso Espaço Especial</h1>
        <p className="mt-4 text-lg text-gray-600">Uma viagem pelos nossos momentos e memórias juntos.</p>
      </div>
      <img src="/caminho/para/a/imagem/de/capa.jpg" alt="Imagem de Capa" className="w-full max-w-4xl rounded-lg shadow-lg" />
      <button className="mt-8 px-6 py-2 bg-pink-500 text-white rounded-full hover:bg-pink-600 transition-colors">
        Vamos começar?
      </button>
    </div>
  );
}

export default PaginaInicial;
